import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'objectToArray',
})
export class ObjectToArrayPipe implements PipeTransform {
  transform(objectValue: any): Array<any> | undefined {
    if (!objectValue) {
      return undefined; // Handle case when input is undefined or null
    }

    if (!(objectValue instanceof Object)) {
      throw new Error('Can not convert non object value to array.');
    }

    return Object.keys(objectValue).map((key) => ({
      key,
      value: objectValue[key],
    }));
  }
}

