import { Injectable, Injector, inject } from '@angular/core';
import {
  AsyncValidatorFn,
  FormBuilder,
  FormGroup,
  ValidationErrors,
  ValidatorFn,
  Validators
} from '@angular/forms';
import { FormConfigGroup } from '../classes/config-group.class';
import { FormConfigParameter } from '../classes/config-parameter.class';
import * as syncValidators from '../sync-validators';
import * as asyncValidators from '../async-validators';
import { SyncConfigValidator } from '../classes/sync-config-validator.class';
import { AsyncConfigValidator } from '../classes/async-config-validator.class';
import { UpdateOnEnum } from '../enums/updateon.enum';
import { BehaviorSubject, Observable, Subscription } from 'rxjs';
import { FormControlValue } from '../interfaces/control-value.interface';

@Injectable()
export class FormConfigService {
  private injectedAsyncValidators = {};
  private params: FormConfigGroup = null;
  private $form = new BehaviorSubject<FormGroup>(null);
  private $controls = new BehaviorSubject<any>(null);
  private $valueChanges = new BehaviorSubject<any>(null);
  private $controlValueChanges = new BehaviorSubject<FormControlValue>(null);
  private $statusChanges = new BehaviorSubject<ValidationErrors>(null);

  private valueChangesSubscription: Subscription = null;
  private statusChangesSubscription: Subscription = null;
  private controlValuesSubscriptions = {};

  constructor(private fb: FormBuilder) {
    asyncValidators &&
      Object.keys(asyncValidators).forEach((key) => {
        this.injectedAsyncValidators[key] = inject(asyncValidators[key]);
      });
  }

  public get form(): Observable<FormGroup> {
    return this.$form.asObservable();
  }

  public get controls(): Observable<any> {
    return this.$controls.asObservable();
  }

  public get valueChanges(): Observable<any> {
    return this.$valueChanges.asObservable();
  }

  public get controlValueChanges(): Observable<FormControlValue> {
    return this.$controlValueChanges.asObservable();
  }

  public get statusChanges(): Observable<ValidationErrors> {
    return this.$statusChanges.asObservable();
  }

  private getSyncValidators(
    sVlds: Array<SyncConfigValidator>
  ): Array<ValidatorFn> {
    return (
      sVlds?.map((vd) => {
        let vld;
        switch (vd.name) {
          case 'required':
          case 'email':
            vld = Validators[vd.name];
            break;
          case 'min':
          case 'max':
          case 'minLength':
          case 'maxLength':
            vld = Validators[vd.name](vd.params[0]);
            break;
          default:
            vld = syncValidators[vd.name];
            break;
        }

        if (!vld) {
          throw new Error(`${vd.name} validator does not exist.`);
        }

        return vld;
      }) || []
    );
  }

  private getAsyncValidators(
    sVlds: Array<AsyncConfigValidator>
  ): Array<AsyncValidatorFn> {
    return (
      sVlds?.map((vd) => {
        const asyncValidator = this.injectedAsyncValidators[vd.name];
        if (!asyncValidator) {
          throw new Error(`${vd.name} validator does not exist.`);
        }
        asyncValidator['url'] = vd.url;
        return asyncValidator.validate.bind(asyncValidator);
      }) || []
    );
  }

  private removeControlValueChangeSubscriptions(controls): any {
    if (!controls) return null;

    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      // group
      if (control.controls) {
        control.groupControl?.unsubscribe();
        this.removeControlValueChangeSubscriptions(control.controls);
      } else {
        // single control
        control?.unsubscribe();
      }
    });
  }

  private addControlValueChangeSubscriptions(controls: any): any {
    if (!controls) return null;
    const subscriptions = {};

    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      // group
      if (control.controls) {
        subscriptions[key] = {
          groupControl: control.groupControl.valueChanges.subscribe((value) =>
            this.$controlValueChanges.next({
              key,
              value,
              control: control.groupControl
            })
          ),
          controls: this.addControlValueChangeSubscriptions(control.controls)
        };
      } else {
        // single control
        subscriptions[key] = control.valueChanges.subscribe((value) =>
          this.$controlValueChanges.next({
            key,
            value,
            control
          })
        );
      }
    });

    return subscriptions;
  }

  private getControls(form: FormGroup): any {
    if (!form?.controls) return null;
    const controls = {};

    Object.keys(form.controls).forEach((key) => {
      const control = form.controls[key];
      if (control['controls']) {
        controls[key] = {
          groupControl: form.get(key),
          controls: this.getControls(control as FormGroup)
        };
      } else {
        controls[key] = form.get(key);
      }
    });

    return controls;
  }

  private getParamAsyncValidators(
    cParam: FormConfigParameter
  ): Array<AsyncValidatorFn> {
    return this.getAsyncValidators(cParam.asyncValidators);
  }

  private getControlErrors(controls): ValidationErrors {
    let errors = null;

    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      if (control.controls) {
        errors = {
          ...(errors || {}),
          ...(this.getControlErrors(control.controls) || {})
        };
      } else {
        const controlErrors = controls[key].errors;
        if (controlErrors) {
          errors = { ...(errors || {}), controlErrors };
        }
      }
    });

    return errors;
  }

  private removeAsyncValidators(controls): void {
    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      if (control.controls) {
        control.clearAsyncValidators();
        this.removeAsyncValidators(control.controls);
      } else {
        control.clearAsyncValidators();
      }
    });
  }

  private addAsyncValidators(controls, params: FormConfigGroup): void {
    Object.keys(controls).forEach((key) => {
      const param = params[key];
      const control = controls[key];
      if (control.controls) {
        this.addAsyncValidators(control.controls, param.params);
      } else {
        control.setAsyncValidators(this.getParamAsyncValidators(params[key]));
      }
    });
  }

  public getFormGroup(
    configGroup: FormConfigGroup,
    formParamValues: any
  ): FormGroup {
    if (!configGroup) {
      return null;
    }

    const params = {};

    Object.keys(configGroup).forEach((key) => {
      const cParam: FormConfigParameter = configGroup[key];
      let updateOn = cParam.asyncValidators?.length
        ? { updateOn: UpdateOnEnum.blur }
        : cParam.updateOn
        ? { updateOn: cParam.updateOn }
        : {};

      if (
        ['checkbox', 'radio', 'select', 'date'].includes(cParam.controlType)
      ) {
        updateOn = { updateOn: UpdateOnEnum.change };
      }

      // Param is a groupParam, then create a form group
      if (cParam.controlType === 'group') {
        params[key] = this.getFormGroup(
          cParam.params,
          formParamValues ? formParamValues[key] : null
        );
      } else {
        // Param is Control
        params[key] = [
          cParam.disabled
            ? {
                value:
                  (formParamValues ? formParamValues[key] : null) ||
                  cParam.value,
                disabled: true
              }
            : (formParamValues ? formParamValues[key] : null) || cParam.value,
          this.getSyncValidators(cParam.syncValidators),
          this.getAsyncValidators(cParam.asyncValidators),
          updateOn
        ];
      }
    });

    return this.fb.record(
      { ...params },
      {
        updateOn: UpdateOnEnum.blur
      }
    );
  }

  public initForm(configGroup: FormConfigGroup, formParamValues: any): void {
    this.params = configGroup;

    // Unsubscribe form subscriptions if any
    this.valueChangesSubscription &&
      this.valueChangesSubscription.unsubscribe();
    this.statusChangesSubscription &&
      this.statusChangesSubscription.unsubscribe();
    this.removeControlValueChangeSubscriptions(this.controlValuesSubscriptions);

    const newForm = this.getFormGroup(this.params, formParamValues);
    const controls = this.getControls(newForm);

    this.$form.next(newForm);
    this.$controls.next(controls);

    // Subscribe again the subscriptions
    if (this.$form.value) {
      // Value change subscription
      this.valueChangesSubscription = this.$form.value.valueChanges.subscribe(
        () => {
          this.$valueChanges.next(this.$form.value.getRawValue());
        }
      );
      // Status change subscription
      this.statusChangesSubscription = this.$form.value.statusChanges.subscribe(
        () => {
          this.$statusChanges.next(this.getControlErrors(this.$controls.value));
        }
      );

      // Controls value change subscriptions
      this.controlValuesSubscriptions =
        this.addControlValueChangeSubscriptions(this.$controls.value) || {};
    }
  }

  public patchValue(value: any): void {
    if (!this.$form.value || !value) return;

    // Remove and re-add async validator to skip validation on patchValue
    this.removeAsyncValidators(this.$controls.value);

    // Update values
    this.$form.value.patchValue(value, { emitEvent: false });

    // Add back all async validators
    setTimeout(() =>
      this.addAsyncValidators(this.$controls.value, this.params)
    );
  }
}

import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { BehaviorSubject, Observable, lastValueFrom } from 'rxjs';
import { GlobalConfigParamsEnum } from '../enums/global-config-params.enum';
import {
  RemoteConfigParameter,
  RemoteConfigTemplate
} from 'firebase-admin/lib/remote-config/remote-config-api';

@Injectable({
  providedIn: 'root'
})
export class GlobalConfigService {
  private $url: string = ''; // Will fetch remote config
  private $config = new BehaviorSubject<RemoteConfigTemplate>(null);

  constructor(private http: HttpClient) {}

  public get url(): string {
    return this.$url;
  }

  public set url(v: string) {
    this.$url = v;
  }

  public get config(): Observable<RemoteConfigTemplate> {
    return this.$config.asObservable();
  }
  /**
   * Fetches global config from server
   * Ideally should be called from APP_INITIALIZER
   * @param force
   * @returns
   */
  public async fetch(force: boolean = false): Promise<any> {
    if (!this.url) {
      throw new Error(
        'Url is empty. Please provide api url that can fetch global config.'
      );
    }

    // Serve from cache if available
    if (this.$config.value && !force) {
      return this.$config.value;
    }

    // Fetch from sever database (firebase remote config)

    try {
      const config: any = await lastValueFrom(this.http.get(this.url));
      // Emit next config
      this.$config.next(config);
      return config;
    } catch (error) {
      // reset config
      this.$config.next(null);
      // throw error
      throw error;
    }
  }

  public getValue(key: string | GlobalConfigParamsEnum): any {
    if (!this.$config.value) return null;

    const param = this.$config.value.parameters[key] as RemoteConfigParameter;

    if (param) {
      const value = (param.defaultValue as any)?.value;

      if (param.valueType === 'JSON' && value) {
        return JSON.parse(value);
      }

      return value;
    }

    throw new Error(`Param - ${key} does not exist in global config.`);
  }
}

import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import {
  AbstractControl,
  AsyncValidator,
  ValidationErrors
} from '@angular/forms';
import { Pincode } from '@annuadvent/ngx-core/helpers-ecommerce';
import { Observable, catchError, map, of } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class PincodeValidatorService implements AsyncValidator {
  private $url = '';
  constructor(private http: HttpClient) {}

  public set url(v: string) {
    this.$url = v;
  }

  validate(control: AbstractControl): Observable<ValidationErrors | null> {
    const id = control.value;

    return this.http.get(`${this.$url}/${id}`).pipe(
      map((pincode) => {
        const city = control.parent.get('city');
        const state = control.parent.get('state');
        city?.setValue((pincode as Pincode).city);
        state?.setValue((pincode as Pincode).state);
        return null;
      }),
      catchError((error) => {
        const formError: ValidationErrors = {
          pincode: {
            message: 'Pincode does not exist.'
          }
        };

        return of(formError);
      })
    );
  }
}

import { Injectable } from '@angular/core';

/**
 * UtilsService exports all the methods that provides some common utility.
 *
 * @export
 * @class UtilsService
 * @typedef {UtilsService}
 */
@Injectable({
  providedIn: 'root'
})
export class UtilsService {
  constructor() {}

  //

  /**
   * Replaces all upperCase letters to lowercase precided with '-' dash
   * @param str
   * @returns dashed string
   */
  public camelCaseToDashCase(str: string): string {
    if (!str) return '';
    return str
      .split('')
      .map((c) => (c === c.toUpperCase() ? `-${c.toLowerCase()}` : c))
      .join('');
  }

  /**
   * Joins the Url segments and forms a url, stripes out any trailing extra slashes from the segments before joing them.
   * @param urlSegments
   * @returns joined Urls
   */
  public joinUrl(urlSegments: Array<string>): string {
    const cleanedSegmenmts = urlSegments.map((str, index) => {
      let cleanSegment = str;

      switch (index) {
        case 0:
          if (str.endsWith('/')) {
            cleanSegment = str.substring(0, str.length - 2);
          }
          break;
        case urlSegments.length - 1:
          if (str.startsWith('/')) {
            cleanSegment = str.substring(1, str.length);
          }
          break;
        default:
          if (cleanSegment.endsWith('/')) {
            cleanSegment = cleanSegment.substring(0, cleanSegment.length - 2);
          }

          if (cleanSegment.startsWith('/')) {
            cleanSegment = cleanSegment.substring(1, cleanSegment.length);
          }
      }

      return cleanSegment;
    });

    return cleanedSegmenmts.join('/');
  }

  /**
   * Returns the current Date from browser in the ISO format.
   *
   * @public
   * @readonly
   * @type {string}
   */
  public get currentDate(): string {
    return new Date().toISOString();
  }

  /**
   * Returns a local date string
   * @date 26/2/2022 - 9:48:21 am
   *
   * @public
   * @param {string} date
   * @returns {string}
   */
  public dateToLocalString(date: string = ''): string {
    if (!date) return '';
    const options: any = { year: 'numeric', month: 'short', day: 'numeric' };
    const dt = new Date(date);
    return dt.toLocaleDateString('en-US', options);
  }

  /**
   * Converts ISOString date string to its equivalent time in milliseconds since 1970, returns numeric value as a string.
   * @date 12/28/2022 - 6:04:39 PM
   *
   * @public
   * @param {string} dateStr
   * @returns {string}
   */
  public dateStringToTotalTimeString(dateStr: string): string {
    let timeStr = '';

    try {
      if (dateStr) {
        const dt = new Date(dateStr);
        timeStr = dt.getTime().toString();
      }
    } catch (err) {}

    return timeStr;
  }

  /**
   * Converts total time in milliseconds since 1970 (numbered string) to its equivalent ISOString date string.
   * @date 12/28/2022 - 6:04:39 PM
   *
   * @public
   * @param {string} timeStr
   * @returns {string}
   */
  public totalTimeStringToUTCdateString(timeStr: string): string {
    let dateStr = '';

    try {
      if (timeStr) {
        dateStr = new Date(Number(timeStr)).toISOString();
      }
    } catch (err) {}

    return dateStr;
  }

  /**
   * Stripe out all special characters from the string too except A-Z, a-z, 0-9.
   * @date 2/12/2023 - 2:01:20 PM
   *
   * @public
   * @param {string} str
   * @returns {string}
   */
  public getStringWithNoSpecialChars(str: string): string {
    if (!str) return '';
    const strArr = str.split('');
    const filteredStr = strArr.filter((char) => {
      if (
        (char >= 'A' && char <= 'Z') ||
        (char >= 'a' && char <= 'z') ||
        (char >= '0' && char <= '9') ||
        char === ' '
      ) {
        return true;
      } else {
        return false;
      }
    });

    return filteredStr.join('');
  }

  /**
   * Trims out additional consecutive spaces from a string, also trims spaces from end of the string.
   * @date 2/12/2023 - 9:54:48 PM
   *
   * @public
   * @param {string} str
   * @returns {string}
   */
  public trimConsecutiveSpaces(str: string): string {
    if (!str) return '';

    return str
      .split('')
      .filter((char, index) => {
        if (char === ' ') {
          if (index === str.length - 1) {
            return false;
          } else if (str[index + 1] === ' ') {
            return false;
          } else {
            return true;
          }
        } else {
          return true;
        }
      })
      .join('');
  }

  /**
   * Converts a string into dashed string. All spaces are replaced with dashes.
   * This converted string can be used for getting a unique name for a title of any content like, article etc.
   *
   * @param title
   * @returns
   */
  public toDashedString(title: string = ''): string {
    // trims additional spaces from a string.
    const spacesTrimmedStr = this.trimConsecutiveSpaces(title);
    // Stripe out all special characters from the string too except A-Z, a-z, 0-9.
    const titleWithNoSpecialChars =
      this.getStringWithNoSpecialChars(spacesTrimmedStr);
    return titleWithNoSpecialChars.split(' ').join('-').toLocaleLowerCase();
  }

  /**
   * Scrolls the page to the desired top position.
   * @date 25/2/2022 - 5:28:11 pm
   *
   * @public
   * @param {number} top
   */
  public scrollTo(top: number = 0) {
    if (typeof window !== 'undefined') {
      window.scrollTo({ top: top });
    }
  }

  public getTrimmedStringByChars(str: string, count: number = 0): string {
    if (!str || typeof str !== 'string' || !count || count <= 0) {
      return str;
    }

    return str.substring(0, count) + '...';
  }

  /**
   * Generates a unique ID from a string by adding dashes for spaces and adding a unique string.
   * @date 14/4/2022 - 2:39:05 pm
   *
   * @public
   * @param {string} [str='']
   * @returns {string}
   */
  public getUniqueFromString(str: string = ''): string {
    const dashed = this.toDashedString(str);
    const rndStr = Math.random().toString(36).substring(2);
    const uniqueId =
      Date.now().toString(36) + rndStr.substring(rndStr.length / 3);

    return `${dashed}-${uniqueId}`;
  }

  /**
   * Deep copy an object or an array
   * @date 2/28/2023 - 3:22:38 AM
   *
   * @public
   * @param {(any)} value
   * @returns {(any)}
   */
  public deepCopy(value: any): any {
    try {
      return JSON.parse(JSON.stringify(value));
    } catch (err) {
      return null;
    }
  }

  public delay(miliseconds: number): Promise<unknown> {
    return new Promise((resolve) => setTimeout(resolve, miliseconds));
  }

  /**
   * Generates Image source urls to be displayed from API.
   * Note: Do not provide base url, while saving urls to db, but while displaying only.
   * @date 6/4/2023 - 12:27:34 AM
   *
   * @public
   * @param {string} imageFullPath
   * @param {string} imageApiEndpoint
   * @param {string} [baseUrl='']
   * @returns {string}
   */
  public getImageUrl(
    imageFullPath: string,
    imageApiEndpoint: string,
    baseUrl: string = ''
  ): string {
    const imageApiUrl = `${imageApiEndpoint}${imageFullPath}`;
    return baseUrl ? this.joinUrl([baseUrl, imageApiUrl]) : imageApiUrl;
  }

  /**
   * Generates the canonical categiry or article url.
   * Note: Do not provide base url, while saving urls to db, but while displaying only.
   * @date 6/4/2023 - 12:17:52 AM
   *
   * @public
   * @param {string} categoryid
   * @param {string} [articleId='']
   * Provide only when displaying the url, and not while saving to db.
   * @param {string} [baseUrl='']
   * @returns {string}
   */
  public getCanonicalUrl(
    categoryid: string,
    articleId: string = '',
    baseUrl: string = ''
  ): string {
    const articleSegment = articleId ? `/${articleId}` : '';
    const catId = categoryid.indexOf('/') === 0 ? categoryid : `/${categoryid}`;
    return baseUrl
      ? this.joinUrl([baseUrl, catId, articleSegment])
      : `${catId}${articleSegment}`;
  }

  /**
   * Replaces single quotes in a string with double quotes.
   * @param str
   * @returns
   */
  public replaceSingleWithDoubleQuotes(str: string): string {
    if (!str) return str;
    str = str.replace(/'/g, '"');

    return str;
  }

  /**
   * Removes double \\n chars from string.
   * @param str
   * @returns
   */
  public removeDoubleLineBreakChar(str: string): string {
    if (!str) return str;
    str = str.replace(/\\n/g, '\n');

    return str;
  }

  /**
   * Strips out starting and ending single/double quotes from a string.
   * @param str
   * @returns
   */
  public stripsOutQuotesFromStartAndEnd(str: string): string {
    if (!str) return str;

    if (
      (str.startsWith("'") && str.endsWith("'")) ||
      (str.startsWith('"') && str.endsWith('"'))
    ) {
      str = str.substring(1);
      str = str.substring(0, str.length - 1);
    }

    return str;
  }

  /**
   * Gives a natural comma separetd string from an array of strings.
   * Last comma in the string is replaced with 'and', being a natural language string.
   * @param stringArray
   * @returns string
   */
  public nauturalJoinArray(stringArray: Array<string>): string {
    return `${stringArray.slice(0, stringArray.length - 1).join(', ')} and ${
      stringArray[stringArray.length - 1]
    }`;
  }

  /**
   * Parses a remoteConfig (firebase) to a valid value. Removes intermediate nested vars
   */

  public getRemoteConfigValue(remoteConfig: any, key: string) {
    if (!remoteConfig || !key) return null;

    const param = remoteConfig.parameters[key];

    if (param) {
      const value = (param.defaultValue as any)?.value;

      if (param.valueType === 'JSON' && value) {
        return JSON.parse(value);
      }

      return value;
    }

    throw new Error(`Param - ${key} does not exist in global config.`);
  }
}

